    public static function distanceBetweenXYZ($x1, $y1, $z1, $x2, $y2, $z2, ): float
    {
        return sqrt(pow($x1 - $x2, 2) + pow($y1 - $y2, 2) + pow($z1 - $z2, 2));
    }

    public static function distanceBetween($fromId, $toId): float
    {
        $from = System::find($fromId);
        $to = System::find($toId);
        return sqrt(pow($from->x - $to->x, 2) + pow($from->y - $to->y, 2) + pow($from->z - $to->z, 2));
    }

    public static function distanceSol($x, $y, $z): float
    {
        return sqrt(pow($x - 0, 2) + pow($y - 0, 2) + pow($z - 0, 2));
    }

    public static function isScoopable(string $type): bool
    {
        return in_array($type, ED::$scoopable);
        
    }

    public static function isMainStar(float $distance): bool
    {   
        return $distance == 0.0;
    }

